var digit = "";

var i = 0;
var endPoint = digit.length - 13;
var greatestProduct = 0;
var temp;

while (i <= endPoint) {
	temp = digit[i] * digit[i + 1] * digit[i + 2] * digit[i + 3] * digit[i + 4] * digit[i + 5] * digit[i + 6] * digit[i + 7] * digit[i + 8]* digit[i + 9] * digit[i + 10] * digit[i + 11] * digit[i + 12];
	if (temp > greatestProduct) {
		greatestProduct = temp;
	}
	i++;
}

console.log(greatestProduct)
